import React, { useEffect } from 'react';
import CommentSection from './components/CommentSection/CommentSection';
import useCommentStore from './hooks/commentStore';
import './compstyles/global.css';
import './App.css';

const App = () => {
  const loadComments = useCommentStore((state) => state.loadComments);

  useEffect(() => {
    loadComments();
  }, [loadComments]);

  return (
    <div className="App">
      <h1>Comments Section</h1>
      <CommentSection />
    </div>
  );
};

export default App;
